import React from "react";

export default function AddTags() {
  return (
    <>
      <div className="new-tags-container">
        <button>Add tag</button>
        <input></input>
        <div className="add-tags-container"></div>
      </div>
      <button className="update-tags-btn">Update Tags</button>
    </>
  );
}
